import React from 'react';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core/styles';
import Link from '@material-ui/core/Link';

const useStyle = makeStyles(theme => ({
    container:{
        height: '90vh',
        overflow: 'scroll',
        flexDirection:'column',
        maxWidth: '700px',
    },
    itemContainer:{
        display: 'flex',
        flexDirection:'row',
        height: '27vh',
        [theme.breakpoints.down('md')]:{
            height:'18vh'
        },
        width:'100%',
        backgroundColor:'#f4f4f4',
        marginTop: '1vh',
        marginBottom:'1vh'
    },
    profile:{
        display:'flex',
        width: '35%',
        height: '100%',
        backgroundColor:'#cccccc',
    },
    info:{
        display:'flex',
        flexDirection:'column',
        width:'65%',
        height:'100%',
        fontSize: '15px',
        fontWeight: 'bold',
        [theme.breakpoints.down('md')]:{
            fontSize: '1.5vh',
        }
    },
    name:{
        display: 'flex',
        padding: '5%',
        width: '50%'
    },
    title:{
        display: 'flex',
        flexDirection: 'row',
        width: '100%',
    },
    address:{
        display: 'flex',
        flexDirection: 'column',
        width: '50%',
        textAlign: 'right',
        paddingRight:'5%'
    },
    rating:{
        display: 'flex',
        flexDirection: 'row',
        height: '14px',
        width: '100%',
        [theme.breakpoints.up('md')]:{
            height: '20px',
        },
        textAlign: 'right'
    },
    stars:{
        display: 'flex',
        width: '85px',
        height: '14px',
        [theme.breakpoints.up('md')]:{
            width: '120px',
            height: '20px',
        },
        background: "url(" + require('../../static/rating/small_4.png') + ")",
        backgroundSize: 'cover',
        marginLeft: '5%',
        marginRight: '3%'
    },
    reviews:{
        fontSize: '12px',
        [theme.breakpoints.down('md')]:{
            fontSize: '1vh',
        },
        paddingTop:'2px'
    }
}))

const ResultList = () => {
    const classes = useStyle();
    return (
        <Container className={classes.container}>
            {[0, 1, 2, 3, 4, 5].map(value => (
                <div id={value} className={classes.itemContainer}>
                    <div className={classes.profile}></div>
                    <div className={classes.info}>
                        <div className={classes.title}>
                            <Link href={`/detail/:${value}`} className={classes.name}>Coconuts Caribbean Restaurant & Bar</Link>
                            <div className={classes.address}>
                                <p>
                                    475 3rd St
                                    <br/>
                                    San Francisco, CA
                                    <br/>
                                    94107
                                </p>
                            </div>
                        </div>
                        <div className={classes.rating}>
                            <div className={classes.stars}></div>
                             <span className={classes.reviews}>9762 reviews</span>
                        </div>
                    </div>
                </div>))
            }
        </Container>
    )
}

export default ResultList;
